package io.naradrama.easyboard.aggregate.posting.domain.entity.sdo;

import io.naradrama.prologue.domain.IdName;
import io.naradrama.prologue.util.json.JsonSerializable;
import io.naradrama.prologue.util.json.JsonUtil;
import lombok.AllArgsConstructor;
import lombok.Getter;
import lombok.NoArgsConstructor;
import lombok.Setter;

import java.util.UUID;

@Getter
@Setter
@NoArgsConstructor
@AllArgsConstructor
public class PostingCdo implements JsonSerializable {
    //
    private String writerId;
    private String writerName;
    private String title; // post title
    private String content;
    private String base64AttachedImage;
    private String boardId;           //  boardId;

    @Override
    public String toString() {
        //
        return toJson();
    }

    public static PostingCdo fromJson(String json) {
        //
        return JsonUtil.fromJson(json, PostingCdo.class);
    }

    public static PostingCdo sample() {
        //
        IdName writer = IdName.sample();
        String writerId = writer.getId();
        String writerName = writer.getName();
        String title = "Posting title represents here.";
        String content = "Post and title";
        String base64AttachedImage = "data:image/jpg;base64,";
        String boardId = UUID.randomUUID().toString();

        PostingCdo sample = new PostingCdo(writerId, writerName, title, content, base64AttachedImage, boardId);

        return sample;
    }

    public static void main(String[] args) {
        //
        System.out.println(sample().toPrettyJson());
    }
}
